	add("schism", "{\"term\":\"schism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027cisme\u0027 or \u0027scisme\u0027 from Ancient greek (to 1453) \u0027lang\u003dgrc|σχίσμα\u0027 () from \u0027σχίζω\u0027 (i split)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A split or separation within a group or organization, typically caused by discord\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A formal division or split within a religious body\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027schism\u0027\u0027 between Sunnis and Shias happened quite early in Islamic history\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a split within Christianity whereby a group no longer recognizes the Bishop of Rome as the head of the Church, but shares essentially the same beliefs with the Church of Rome. In other words, a political split without the introduction of heresy\", \"priority\":4}]}, \"synonyms\":{}}");

