	add("scholar", "{\"term\":\"scholar\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027scoler\u0027 from Old english (ca. 450-1100) {{m|ang|scōlere||scholar, learner}}, from {{m|la|scholāris}}, from \u0027schola\u0027 (school) equivalent to {{suffix|school|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A student; one who studies at school or college\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A specialist in a particular branch of knowledge\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A learned person; a bookman\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/the-evolution-of-eyeglasses The Evolution of passage\u003dThe ability of a segment of a glass sphere to magnify whatever is placed before it was known around the year 1000, when the spherical segment was called a reading stone,. Scribes, illuminators, and \u0027\u0027scholars\u0027\u0027 held such stones directly over manuscript pages as an aid in seeing what was being written, drawn, or read\", \"priority\":4}]}, \"synonyms\":{}}");

