	add("schooner", "{\"term\":\"schooner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sailing ship with two or more masts, all with fore-and-aft sails; if two masted, having a foremast and a mainmast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Reese Palley, \u0027The Best of Nautical Quarterly: Volume 1: The Lure of Sail\u0027, %22schooners%22+-intitle:%22schooner|schooners%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d9_kPf3u6_i\u0026amp;sig\u003dEUPQF_aEJj8wVX7uboO9cScpLtQ\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU7Y4UNWtGIiImQXol4CoAg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22schooners%22%20-intitle%3A%22schooner|schooners%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 181\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Designed by Frank Payne\u0027s renowned Boston design office, and built in 1928 of longleaf yellow pine, this 82-footer has been a racing \u0027\u0027schooner\u0027\u0027 — a staysail \u0027\u0027schooner\u0027\u0027 — since the heyday of \u0027Class-A\u0027 ocean racing in \u0027\u0027schooners\u0027\u0027 during the late 1920s and early 1930s\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Otmar Schäuffelen, \u0027Chapman: Great Sailing Ships of the World\u0027, %22schooners%22+-intitle:%22schooner|schooners%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d9SABXWyR9e\u0026amp;sig\u003d0RFpr55RLef8EIVWAATBU3IdhRg\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU7Y4UNWtGIiImQXol4CoAg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22schooners%22%20-intitle%3A%22schooner|schooners%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page xxi\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In addition to the square-rigged sailing ships, the \u0027\u0027schooners\u0027\u0027 were the second largest group of large sailing vessels\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Donald Launer, \u0027Lessons from My Good Old Boat\u0027, %22schooners%22+-intitle:%22schooner|schooners%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dOvSJiHpYHR\u0026amp;sig\u003d1iLd5-W7_mPLdQ2pW5agWpSX63I\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU7Y4UNWtGIiImQXol4CoAg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22schooners%22%20-intitle%3A%22schooner|schooners%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 240\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Unfortunately, anyone looking for a \u0027\u0027schooner\u0027\u0027 today has limited choices. In the used boat market there are always some wooden hulls available, and occasionally ones of steel or aluminum, but fiberglass-hulled \u0027\u0027schooners\u0027\u0027 are harder to come by\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A glass of beer, of a size which varies between states (w:Schooner Wikipedia\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"w:Arthur Arthur Upfield, \u0027Fozen Pumps\u0027, 2008, Kees de Hoog (editor), \u0027Up and Down Australia: Short Stories Selected by Kees de Hoog\u0027, %22schooners%22+australia+-intitle:%22schooner|schooners%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d7OqgHPIGof\u0026amp;sig\u003dkCIg9WnAnaY7MtYReqrE68ssEl0\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dQsI4UOWpCPCwiQeA8oCoDg\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22schooners%22%20australia%20-intitle%3A%22schooner|schooners%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 67\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Foaming \u0027\u0027schooners\u0027\u0027 of beer grew ever larger and more numerous as the crimson February suns went to their rest\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Ken Ewell, \u0027Voyages of Discovery: A Manly Adventure in the Lands Down Under\u0027, %22schooners%22+australia+-intitle:%22schooner|schooners%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d6NeSq04LaX\u0026amp;sig\u003dlO7tdgNVYqo2M8v6FovttLAakcQ\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dQsI4UOWpCPCwiQeA8oCoDg\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22schooners%22%20australia%20-intitle%3A%22schooner|schooners%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 94\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"And needless to say, the Western Australia row will eventually be filled in as well, though not before drinking a \u0027\u0027schooner\u0027\u0027 of the amber nectar in Perth\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Charles Rawlings-Way, Meg Worby, Lindsay Brown, Paul Harding, \u0027Central Australia: Adelaide to Darwin\u0027, Lonely Planet, %22schooners%22+australia+-intitle:%22schooner|schooners%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d5lSlBGW1NT\u0026amp;sig\u003d4PTVtTbNvESl_ZWZ6E8i3bAqSas\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dQsI4UOWpCPCwiQeA8oCoDg\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"%22schooners%22%20australia%20-intitle%3A%22schooner|schooners%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 59\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"For a true Adelaide experience, head for the bar and order a \u0027\u0027schooner\u0027\u0027 of Coopers, the local brew, or a glass of SA′s impressive wine\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A large goblet or drinking glass, used for lager or ale (w:Schooner Wikipedia).\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":21}]}, \"synonyms\":{}}");

	add("schrankschande", "{\"term\":\"schrankschande\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"Compound of German \u0027schrank\u0027 (cabinet) and \u0027schande\u0027 (disgrace)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An item of possession that embarrasses the owner and cannot be easily discarded. Schrankschanden are often of inferior quality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My father gave us a vase. We keep it only on display when he visits. It is a true \u0027\u0027Schrankschande\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His misplaced comment was soon quoted world-wide, making it a \u0027\u0027Schrankschande\u0027\u0027 in his diplomatic CV\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Business is about success and failure: Many companies carry \u0027\u0027Schrankschanden\u0027\u0027 in their company record, such as Ford\u0027s Edsel\", \"priority\":4}]}, \"synonyms\":{}}");

